window.bookSummaryJSON = "<p><b>A generation of radical change. Tenuous balance ready to tip. Opportunities and danger in every corner.</b></p> <p>Ronan and his friends stumble upon what remains of humanity after surviving the gauntlet that was their arrival. While both groups are supremely wary of each other, the necessity of cooperation wins out in the end.&nbsp;</p> <p>No one was expecting that the balance of power within the town of Wildwood was so fragile. Seeking to address the desperate need for resources leads Ronan to pitch his wildest idea yet: Dungeon Farming. The wildlife doesnâ€™t take the sudden boldness of humanity in stride, but armed with more magic than ever, the stage is set for the survivors to thrive.&nbsp;</p> <p>All too soon, the threat of the wild grow distant enough that people are already starting to forget the dangers...and the resurgent humanity is threatened from within.</p>"; 
